
DROP DATABASE IF EXISTS PlanMetro;
CREATE DATABASE PlanMetro;

USE PlanMetro;

CREATE TABLE LIGNES(
    id INT PRIMARY KEY,
    color VARCHAR(256),
    name VARCHAR(256),
    num INT,
    show_ BOOLEAN,
    type_ VARCHAR(256)) ENGINE=InnoDB;

CREATE TABLE STATIONS(
    id INT PRIMARY KEY,
    commune VARCHAR(256),
    cp VARCHAR(256),
    isAmbiguous BOOLEAN,
    isHub BOOLEAN,
    lat FLOAT,
    lng FLOAT,
    nom VARCHAR(256),
    num INT,
    show_ BOOLEAN,
    type_ VARCHAR(256)) ENGINE=InnoDB;
    
CREATE TABLE LIGNES_STATIONS(
    ligne_id INT,
    station_id INT,
    ordre INT,
    PRIMARY KEY(ligne_id,station_id),
    FOREIGN KEY (ligne_id) REFERENCES LIGNES(id),
    FOREIGN KEY (station_id) REFERENCES STATIONS(id) ) ENGINE=InnoDB;
    

